import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import SpongeBobCard from "./components/SpongeBobCard";

function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <SpongeBobCard 
        name="SpongeBob" 
        occupation="fry-cook"
        location="Pineapple under the sea"
        imageAlt="SpongeBob"
        imageSrc="https://vignette.wikia.nocookie.net/spongebobgalaxy/images/0/07/SpongeBob_SquarePants.png/revision/latest?cb=20171228024014"
      />
      <SpongeBobCard 
        name="Mr. Krabs" 
        occupation="Restaurant Owner"
        location="A Giant Anchor"
        imageAlt="Mr. Krabs"
        imageSrc="https://vignette3.wikia.nocookie.net/vsbattles/images/8/80/Mr._Krabs.png/revision/latest?cb=20150919162131"
      />
      <SpongeBobCard 
        name="Squidward" 
        occupation="Cashier"
        location="An Easter Island Head"
        imageAlt="Squidward"
        imageSrc="https://vignette2.wikia.nocookie.net/fictionalcharacters/images/a/ac/Squidward.png/revision/latest?cb=20131121012626"
      />

    </Wrapper>
  );
}

export default App;
